import './App.scss';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <div className="app-logo-desktop">
          <img src={logo} alt="logo" />
        </div>
        <div>

        </div>
      </header>
    </div>
  );
}

export default App;
